('3306241f-2270-4172-a8f2-bed2bc1f6402','โซนกรุงเทพฯชั้นใน','เขตพระนคร, เขตดุสิต, เขตบางรัก, เขตปทุมวัน, เขตป้อมปราบศัตรูพ่าย,เขตพระโขนง,เขตยานนาวา,เขตสัมพันธวงศ์,เขตพญาไท,เขตธนบุรี,เขตบางกอกใหญ่,เขตห้วยขวาง,เขตคลองสาน,เขตตลิ่งชัน,เขตบางกอกน้อย,เขตราษฎร์บูรณะ,เขตบางพลัด,เขตดินแดง,เขตสาทร,เขตบางซื่อ,เขตจตุจักร,เขตบางคอแหลม,เขตคลองเตย,เขตสวนหลวง,เขตจอมทอง,เขตราชเทวี,เขตลาดพร้าว,เขตวัฒนา,เขตวังทองหลาง,เขตบางกะปิ,เขตภาษีเจริญ','2016-12-20 17:10:21'),
('85726a94-f34d-48da-8c1e-007556e24c7d','โซนทิศตะวันออกเฉียงใต้','เขตบางนา,เขตประเวศ,อ.บางเสาธง,อ.บางพลี,\r\nอ.เมืองสมุทรปราการ,อ.บางบ่อ,อ.บางปะกง,อ.บ้านโพธิ์(ฉะเชิงเทรา),อ.เมืองชลบุรี','2016-12-20 17:09:11'),
('9bc46fdd-8214-4061-adb0-86aadc3c4c97','โซนทิศตะวันออก','เขตมีนบุรี,เขตบึงกุ่ม,เขตคันนายาว,เขตสะพานสูง,เขตคลองสามวา,เขตหนองจอก,เขตลาดกระบัง,อ.เมืองฉะเชิงเทรา,อ.บางน้ำเปรี้ยว,อ.พนมสารคาม,อ.ราชสาส์น,\r\nอ.สนามชัยเขต,อ.ท่าตะเกียบ,อ.แปลงยาว,อ.คลองเขื่อน','2016-12-20 17:10:40'),
('b0e36b3b-afa4-4734-9828-ea445c04f387','โซนทิศเหนือ','เขตบางเขน,เขตหลักสี่,เขตดอนเมือง,เขตสายไหม,อ.ลำลูกกา,อ.ธัญบุรี,\r\nอ.คลองหลวง,อ.เมืองปทุมธานี,อ.สามโคก,อ.ลาดหลุมแก้ว,อ.หนองเสือ,อ.ปากเกร็ด,\r\nอ.เมืองนนทบุรี,อ.บางกรวย,อ.บางบัวทอง,อ.บางใหญ่,อ.ไทรน้อย\r\n','2016-12-20 20:53:49'),
('b2cde841-cfe7-48c9-a6f9-5256fc99aea2','โซนทิศตะวันตก','เขตทุ่งครุ,เขตบางขุนเทียน,เขตบางบอน,เขตบางแค,เขตทวีวัฒนา,\r\nเขตหนองแขม,อ.สามพราน,อ.พุทธมณฑล,อ.นครชัยศรี,อ.บางเลน,อ.ดอนตูม,อ.เมืองนครปฐม,อ.กำแพงแสน,อ.พระสมุทรเจดีย์,อ.พระประแดง,อ.กระทุ่มแบน,อ.เมืองสมุทรสาคร,อ.บ้านแพ้ว','2016-12-20 17:09:49'),
